import './CountdownTimer.css';

const CountdownTimer = () => {
    return (
        <div className="countdown-timer">
            <span>30</span>
            <span>days</span>
            <span>12</span>
            <span>hours</span>
            <span>4</span>
            <span>minutes</span>
            <span>32</span>
            <span>seconds</span>
        </div>
    );
}

export default CountdownTimer;
